import React, { useEffect, useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
  const [user, setUser] = useState(null);
  const [favorites, setFavorites] = useState([]);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    setUser(storedUser);

    if (storedUser?.userId) {
      fetchFavorites(storedUser.userId);
      fetchOrders(storedUser.userId);
    }
  }, []);

  const fetchFavorites = async (userId) => {
    try {
      const res = await fetch(`http://localhost:5085/api/favorite/${userId}`);
      const data = await res.json();
      setFavorites(data);
    } catch (err) {
      console.error("Ошибка загрузки избранного:", err);
    }
  };

  const fetchOrders = async (userId) => {
    try {
      const res = await fetch(`http://localhost:5085/api/orders/user/${userId}`);
      const data = await res.json();
      setOrders(data);
    } catch (err) {
      console.error("Ошибка загрузки заказов:", err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("user");
    window.location.href = "/";
  };

  return (
    <div className="profile-container">
      <h2>Профиль</h2>

      {user && (
        <div className="profile-info">
          <p><strong>Имя:</strong> {user.username}</p>
          <p><strong>Email:</strong> {user.email}</p>
          <button className="logout-btn" onClick={handleLogout}>Выйти</button>
        </div>
      )}

      <div className="profile-orders">
        <h3>Мои заказы</h3>
        {orders.length === 0 ? (
          <p>Вы ещё не оформляли заказы.</p>
        ) : (
          <ul className="order-list">
            {orders.map(order => (
              <li key={order.orderId} className="order-item">
                <span><strong>Заказ №:</strong> {order.orderId}</span>
                <span><strong>Дата:</strong> {new Date(order.createdAt).toLocaleDateString()}</span>
                <span><strong>Сумма:</strong> {order.totalAmount.toLocaleString()} BYN</span>
              </li>
            ))}
          </ul>
        )}
      </div>

      <div className="profile-favorites">
        <h3>Избранные товары</h3>
        {favorites.length === 0 ? (
          <p>У вас нет избранных товаров.</p>
        ) : (
          <div className="favorites-grid">
            {favorites.map(item => (
              <div key={item.product.productId} className="favorite-card">
                <img src={item.product.images?.[0]?.imageUrl || "/img/placeholder.png"} alt={item.product.name} />
                <p>{item.product.name}</p>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default ProfilePage;
